  name: INativeExtractor
  nameWithType: INativeExtractor
  fullName: Sdl.FileTypeSupport.Framework.NativeApi.INativeExtractor
  type: Interface
  assemblies:
  - Sdl.FileTypeSupport.Framework.Core
  namespace: Sdl.FileTypeSupport.Framework.NativeApi
  summary: >-
    <p>

    Manages the <xref href="Sdl.FileTypeSupport.Framework.NativeApi.INativeExtractor.Parser" data-throw-if-not-resolved="false"></xref> used to process the native file as well as a set

    of <xref href="Sdl.FileTypeSupport.Framework.NativeApi.INativeExtractionContentProcessor" data-throw-if-not-resolved="false"></xref> components that processes the

    output of the parser.

    </p>

    <p>

    The result of the processing consists of calls to the <xref href="Sdl.FileTypeSupport.Framework.NativeApi.INativeExtractor.Output" data-throw-if-not-resolved="false"></xref>.

    </p>
  remarks: >-
    <p>

    Used together with other components in a <xref href="Sdl.FileTypeSupport.Framework.IntegrationApi.IFileExtractor" data-throw-if-not-resolved="false"></xref> to 

    extract content from a native file.

    </p>
  example: []
  syntax:
    content: public interface INativeExtractor
    content.vb: Public Interface INativeExtractor
